//     <>
//       <Note title={noteItem.title} content={noteItem.content} />
//     </>
//   );
// }

function App() {
  return (
    <div>
      <Header />
      {notes.map(function createNote(noteItem) {
        return (
          <>
            <Note title={noteItem.title} content={noteItem.content} />
          </>
        );
      })}
      <Footer />
    </div>
  );
}

export default App;
